import React, { Component } from 'react';
import { Button, Navbar,Form,Nav,FormControl } from 'react-bootstrap'
import fire from '../../cofigFile/firebase';


export default class cnavbar extends Component {


    logout(){
        fire.auth().signOut();
    }

    render() {
        return (

            <Navbar className="Nav">
            <Navbar.Brand href="/profile"><img className= "logos" src={require("../Images/Logo.JPG")} alt="Logo"  /></Navbar.Brand>
            <Nav className="mr-auto">
                <Nav.Link  href="/Map">Map</Nav.Link>
                <Nav.Link href="/profile" color="black">Profile</Nav.Link>   
            </Nav>
            <Nav inline>
                <Button variant="outlined"   onClick={this.logout}>Logout :)</Button>
            </Nav>
            </Navbar>
        )
    }
}
